#!/usr/bin/python3

# Bipartite Graph 
# Working implementation

def possibleBipartition(N: int, dislikes: List[List[int]], debug=False) -> bool:
    from collections import deque
    like_map = dict()
    for pair in dislikes:
        if pair[0] not in like_map.keys():
            like_map[pair[0]] = set()
        
        if pair[1] not in like_map.keys():
            like_map[pair[1]] = set()
            
        like_map[pair[0]].add(pair[1])
        like_map[pair[1]].add(pair[0])
        
    if debug:
        for k in like_map.keys():
            print ("{}: {}".format(k, like_map[k]))
    
    color = [-1 for x in range(N)]
    q = deque()
    
    for i in range(1, N+1):
        if color[i-1] == -1:
            q.append(i)

        while len(q) > 0:
            node = q.popleft()
            
            if color[node-1] == -1:
                color[node-1] = 0

            if node not in like_map.keys():
                color[node] = 0
                continue
                
            neighbors = like_map[node]
            opp_color = 1 if color[node-1] == 0 else 0

            for n in neighbors:
                if debug:
                    print ("node: {}, color: {}".format(n, color[n-1]))
                if color[n-1] == -1:
                    color[n-1] = opp_color
                    q.append(n)

                elif color[n-1] != opp_color:
                    return False
    
    return True
 
    
    

